import { uploadDocument } from '../services/api';
import React, { useState } from 'react';
import axios from 'axios';

const Upload = () => {
  const [files, setFiles] = useState([]);
  const [uploadProgress, setUploadProgress] = useState({});
  const [uploadedFiles, setUploadedFiles] = useState([]);
  const [error, setError] = useState(null);

  const maxFileSize = 10 * 1024 * 1024; // 10MB
  const allowedTypes = [
    'application/pdf',
    'application/msword',
    'application/vnd.openxmlformats-officedocument.wordprocessingml.document',
    'text/plain'
  ];

  const handleFileChange = (e) => {
    setError(null);
    const selectedFiles = Array.from(e.target.files);
    const validFiles = selectedFiles.filter(file => {
      if (!allowedTypes.includes(file.type)) {
        setError(`File type not allowed: ${file.name}`);
        return false;
      }
      if (file.size > maxFileSize) {
        setError(`File too large (max 10MB): ${file.name}`);
        return false;
      }
      return true;
    });
    setFiles(prev => [...prev, ...validFiles]);
  };

  const handleRemoveFile = (index) => {
    setFiles(prev => prev.filter((_, i) => i !== index));
    setUploadedFiles(prev => prev.filter((_, i) => i !== index));
  };

  const uploadDocument = (file, onProgress) => {
    const formData = new FormData();
    formData.append('file', file);

    return axios.post('http://localhost:5000/api/upload-document', formData, {
      headers: {
        'Content-Type': 'multipart/form-data',
      },
      onUploadProgress: (progressEvent) => {
        const progress = Math.round((progressEvent.loaded * 100) / progressEvent.total);
        onProgress(progress);
      },
    });
  };

  const handleStartUpload = () => {
    setError(null);
    const uploadPromises = files.map(file => {
      return uploadDocument(file, (progress) => {
        setUploadProgress(prev => ({ ...prev, [file.name]: progress }));
      })
      .then(res => {
        const docId = res.data.document_id;
        setUploadedFiles(prev => [...prev, { ...file, id: docId, status: 'uploaded' }]);
      })
      .catch(() => {
        setUploadedFiles(prev => [...prev, { ...file, status: 'error' }]);
      });
    });

    Promise.all(uploadPromises)
      .then(() => {
        alert('All uploads completed');
      })
      .catch(() => {
        alert('Some uploads failed');
      });
  };

  return (
    <div>
      <h2 className="text-2xl font-semibold mb-4">Upload Documents</h2>
      <div
        className="border-2 border-dashed border-gray-300 rounded-lg p-6 mb-4 text-center cursor-pointer hover:border-primary-600 transition-colors"
        onClick={() => document.getElementById('fileInput').click()}
      >
        <p className="text-gray-500">Drag and drop files here or click to select</p>
        <input
          id="fileInput"
          type="file"
          multiple
          className="hidden"
          onChange={handleFileChange}
          accept=".pdf,.doc,.docx,.txt"
        />
      </div>
      {error && <p className="text-red-600 mb-2">{error}</p>}
      <ul className="mb-4">
        {files.map((file, index) => (
          <li key={index} className="flex justify-between items-center border p-2 rounded mb-2">
            <div>
              <p className="font-medium">{file.name}</p>
              <p className="text-sm text-gray-500">{(file.size / 1024).toFixed(2)} KB</p>
              {uploadProgress[file.name] && (
                <p className="text-sm text-blue-600">Uploading: {uploadProgress[file.name]}%</p>
              )}
              {uploadedFiles.find(f => f.name === file.name)?.status === 'error' && (
                <p className="text-sm text-red-600">Upload failed</p>
              )}
            </div>
            <button
              className="text-red-600 hover:text-red-800"
              onClick={() => handleRemoveFile(index)}
            >
              Remove
            </button>
          </li>
        ))}
      </ul>
      <button
        className="btn-primary"
        onClick={handleStartUpload}
        disabled={files.length === 0}
      >
        Start Analysis
      </button>
    </div>
  );
};

export default Upload;
